create table goods_images
(
    img_id    mediumint unsigned auto_increment comment '图片id 自增'
        primary key,
    goods_id  mediumint unsigned           default 0  not null comment '商品id',
    image_url varchar(255)                 default '' not null comment '图片地址',
    img_sort  tinyint(1) unsigned zerofill default 0  null comment '商品缩略图排序,最小的拍最前面',
    album_id  int                                     null comment '相册ID'
)
    charset = utf8;

create index goods_id
    on goods_images (goods_id);

